pragma solidity ^0.4.23;
pragma experimental ABIEncoderV2;

import "../interfaces/IKeyStore.sol"; 


/**
@title Simple entity registry.
@author Entity protocol.
*/
contract SimpleRegistry is IBaseKeyStore {
    /**
    @dev Inner storage item for entities.
    */
    struct RegistryItem { 
        uint index;
        address owner; 
        string value;
        uint[] blockHistory;
        uint timestamp;
    }

    string[] internal itemIndex; 
    mapping(string => RegistryItem) internal items;

    /**
    @notice Event raised when a new item is added to the registry. 
    @param key Key of the item.
    @param index Absolute index of the newly added item. 
    @param owner Owning address of the item.
    */
    event AddItem(string key, uint index, address owner);

    /**
    @notice Event raised when an item is edited in the registry. 
    @param key Key of the item.
    @param index Absolute index of the edited item. 
    @param owner Owning address of the item.
    */
    event EditItem(string key, uint index,  address owner);

    /**
    @notice Event raised when an item is deleted from the registry.
    @param key Key of the item.
    @param owner Owning address of the item.
    */
    event DeleteItem(string key, address owner);

    /**
    @notice Constructor for SimpleRegistry.
    */
    constructor() public {
    }

    /**
    @notice Checks if an item with the specified key "`_key`" exists.
    @param _key Key of item to check.
    @return _exists True if the item exists, otherwise false.
    */
    function hasItem(string _key) public view returns (bool _exists) { 
        if (itemIndex.length == 0) {
            return false; 
        }

        return items[_key].owner != address(0);
    }

    /**
    @notice Get the item content of the specified key "`_key`".
    @param _key Key of item to get.
    @return _owner Owning address of the item.
    @return _value Content of the item.
    @return _timestamp Timestamp of the item. 
    */
    function getItem(string _key)
        public
        view
        returns (
            address _owner,
            string _value,
            uint[] blockHistory,
            uint _timestamp
        )
    {
        RegistryItem storage item = items[_key];
        require(item.owner != address(0), "Item must have an owner assigned.");

        return (item.owner, item.value, item.blockHistory, item.timestamp);
    }

    /**
    @notice Gets the key of the item at the specified index.
    @param _index index to get.
    @return _key Key at index, if any.
    */
    function getKeyOfIndex(uint _index) public view returns (string _key) {
        return itemIndex[_index];
    }

    /*
    NOTE: Web3 does not support struct returns.
    function getRegistryItem(string _key) public view returns (RegistryItem) { 
        RegistryItem storage item = items[_key];
        require(item.owner != address(0));

        return item; 
    }
    */

    /**
    @notice Get the item content of the specified index `_index`.
    @param _index Index of the item to get.
    @return _key Item key.
    @return _owner Owning address of the item.
    @return _value Content of the item.
    @return _timestamp Timestamp of the item. 
    */
    function getAtIndex(uint _index)
        public
        view
        returns (
            string _key,
            address _owner,
            string _value,
            uint[] _blockHistory,
            uint _timestamp
        )
    {
        require(_index < itemIndex.length, "Index must be less than the current count of items in the registry.");

        (_owner, _value, _blockHistory, _timestamp) = getItem(itemIndex[_index]);

        return (itemIndex[_index], _owner, _value, _blockHistory, _timestamp);
    }

    /*
    NOTE: Web3 does not support struct returns.
    function getItemAtIndex(uint _index) public view returns (RegistryItem item) { 
        require(_index < itemIndex.length);
        return items[itemIndex[_index]];
    }
    */

    /**
    @notice Gets the total count of items in the registy.
    @return _count Count of items in the registry.
    */
    function getItemCount() public view returns (uint _count) { 
        return itemIndex.length;
    }

    /**
    @notice Adds an item to the registry. Will fail if an item of the same key
    "`_key`" already exists in the registry. 
    @dev This is designed to be overriden in derived contracts.
    @param _key Item key.
    @param _value Item value.
    @return _success True if successful, otherwise false.
    */
    function addItem(string _key, string _value) public returns (bool _success) { 
        // TODO: Consider making internal?
        require(!hasItem(_key), "Item must not already exist.");

        items[_key].owner = msg.sender;
        items[_key].timestamp = block.timestamp;
        items[_key].value = _value;
        items[_key].index = itemIndex.length; 
        items[_key].blockHistory.push(block.number); // record initial block created

        itemIndex.push(_key);

        emit AddItem(_key, items[_key].index, msg.sender);
        return true;
    }

    /**
    @notice Edits an existing item within the registry. Will fail if an item
    of "`_key`" does not exist, and `message.caller.address()` is not marked
    as the owner of the item.
    @param _key Key of item to edit.
    @param _value New content for the item. 
    @return _success True if successful, otherwise false. 
    */
    function editItem(string _key, string _value) public returns (bool _success) { 
        // TODO: Consider making internal?        
        require(items[_key].owner == msg.sender, "Sender of edit must be owner of item.");

        items[_key].timestamp = block.timestamp;
        items[_key].value = _value;
        items[_key].blockHistory.push(block.number);

        emit EditItem(_key, items[_key].index, msg.sender);
        return true; 
    }

    /**
    @notice Deletes an existing item from the registry. Will fail if an item
    of "`_key`" exists, and `message.caller.address()` is not marked as the owner 
    of the item.
    @param _key Key of item to edit.
    @return _success True if successful, otherwise false. 
    */
    function deleteItem(string _key) public returns (bool _success) {
        // TODO: Consider making internal?        
        require(items[_key].owner == msg.sender, "Sender of delete must be owner of item.");

        uint itemIdx = items[_key].index;

        // Delete from mapping 
        delete items[_key];

        // If it's the last item we don't need to do a swap
        // If it's not the last item, swap the last item into the item being deleted
        uint tail = itemIndex.length - 1;

        if (itemIdx < tail) {
            items[itemIndex[tail]].index = itemIdx;
            itemIndex[itemIdx] = itemIndex[tail];
        }

        delete itemIndex[tail];
        itemIndex.length--;

        // TODO
        emit DeleteItem(_key, msg.sender);
        return true;
    }

    function _transferItem(string _key, address _owner, string _newValue) internal returns (bool _success) { 
        require(hasItem(_key), "Item must exist for transfer.");
        require(_owner != address(0), "New owner address must be non zero.");

        items[_key].owner = _owner;
        items[_key].timestamp = block.timestamp;
        items[_key].value = _newValue;
        items[_key].blockHistory.push(block.number);

        return true;
    }
}

